sys_variable_value.value:
(function execute(inputs, outputs) {

    function isValidLength(str, minLength, maxLength, parentClass, fieldName) {
        var regex = new RegExp(`^.{${minLength},${maxLength}}$`);
        
        if (str && !regex.test(str)) {
            throw new Error(`Validation failed for ${parentClass}.${fieldName}: String length must be between ${minLength} and ${maxLength} characters.`);
        }
        
        return true; 
    }

    if (inputs.val && inputs.val.data && inputs.val.data.advisorSalesDetails) {
        isValidLength(inputs.val.data.advisorSalesDetails.bankBrnch, 4, 4, 'advisorSalesDetails', 'bankBrnch');
        isValidLength(inputs.val.data.advisorSalesDetails.spCode, 5, 12, 'advisorSalesDetails', 'spCode');
    }

    if (inputs.val && inputs.val.data && inputs.val.data.proposerInfos) {
        if (inputs.val.data.proposerInfos.comunctnAddress) {
            isValidLength(inputs.val.data.proposerInfos.comunctnAddress.email, 10, 50, 'proposerInfos.comunctnAddress', 'email');
            isValidLength(inputs.val.data.proposerInfos.comunctnAddress.city, 3, 20, 'proposerInfos.comunctnAddress', 'city');
            isValidLength(inputs.val.data.proposerInfos.comunctnAddress.mobNo, 10, 10, 'proposerInfos.comunctnAddress', 'mobNo');
        }

        if (inputs.val.data.proposerInfos.ecsDetails) {
            isValidLength(inputs.val.data.proposerInfos.ecsDetails.payAccountNo, 4, 40, 'proposerInfos.ecsDetails', 'payAccountNo');
            isValidLength(inputs.val.data.proposerInfos.ecsDetails.payMicrNo, 9, 9, 'proposerInfos.ecsDetails', 'payMicrNo');
            isValidLength(inputs.val.data.proposerInfos.ecsDetails.payIfscCode, 11, 11, 'proposerInfos.ecsDetails', 'payIfscCode');
        }
    }

})(inputs, outputs);

