sys_variable_value.value:
(function execute(inputs, outputs) {

    function mandatoryCheck(main, expectedValue, variable, fieldName) {
        if (main === expectedValue && !variable) {
            throw new Error(`The field "${fieldName}" is required when "${main}" is "${expectedValue}".`);
        }
    }

    if (inputs.val && inputs.val.data && inputs.val.data.proposerInfos) {
        const proposerInfos = inputs.val.data.proposerInfos;

        mandatoryCheck(proposerInfos.occ, 'Professional', proposerInfos.myProf, 'myProf');
        mandatoryCheck(proposerInfos.occ, 'others', proposerInfos.occDesc, 'occDesc');
        mandatoryCheck(proposerInfos.orgType, 'others', proposerInfos.orgTypeDesc, 'orgTypeDesc');
    }

    if (inputs.val && inputs.val.data && inputs.val.data.lifeAssrdInfos) {
        const lifeAssrdInfos = inputs.val.data.lifeAssrdInfos;

        mandatoryCheck(lifeAssrdInfos.occ, 'others', lifeAssrdInfos.occDesc, 'occDesc');
    }

    function checkInsuranceInfo(insuranceInfos) {
        if (!insuranceInfos.sum) {
            throw new Error('The field "sum" is required in insurance information.');
        }
        if (!insuranceInfos.cmpany) {
            throw new Error('The field "cmpany" is required in insurance information.');
        }
    }

    if (inputs.val && inputs.val.data && inputs.val.data.insuranceInfos && inputs.val.data.insuranceInfos[0]) {
        checkInsuranceInfo(inputs.val.data.insuranceInfos[0]);
    }

    function validateNomineeFields(age, frstNm, lstNm, gender, dob, relationship) {
        if (age < 18) {
            if (!frstNm) throw new Error('First name is required for users under 18 years old.');
            if (!lstNm) throw new Error('Last name is required for users under 18 years old.');
            if (!gender) throw new Error('Gender is required for users under 18 years old.');
            if (!dob) throw new Error('Date of birth is required for users under 18 years old.');
            if (!relationship) throw new Error('Relationship is required for users under 18 years old.');
        }
    }

    function validateForm() {
        if (inputs.val && inputs.val.data && inputs.val.data.nomineeInfos && inputs.val.data.nomineeInfos[0]) {
            const nominee = inputs.val.data.nomineeInfos[0];
            const dateOfBirth = nominee.dob;
            const apnteDtls = nominee.apnteDtls || {};

            if (!dateOfBirth) {
                throw new Error('Date of birth is required.');
            }

            const [day, month, year] = dateOfBirth.split('-').map(Number);
            const birthDate = new Date(year, month - 1, day);
            const today = new Date();

            let age = today.getFullYear() - birthDate.getFullYear();
            const monthDiff = today.getMonth() - birthDate.getMonth();
            if (monthDiff < 0 || (monthDiff === 0 && today.getDate() < birthDate.getDate())) {
                age--;
            }

            validateNomineeFields(age, apnteDtls.frstNm, apnteDtls.lstNm, apnteDtls.gender, apnteDtls.dob, apnteDtls.relationship);
        }
    }

    validateForm();

})(inputs, outputs);

