sys_variable_value.value:
(function execute(inputs, outputs) {

    // Validate PAN
    function validatePAN(inputStr) {
        if (!inputStr) return;
        var regex = /^[A-Z]{5}[0-9]{4}[A-Z]$/;
        if (!regex.test(inputStr)) {
            throw new Error("Invalid PAN card format. It should be 5 letters, followed by 4 digits, and 1 letter.");
        }
        return true;
    }

    // Validate Email
    function validateEmail(inputStr) {
        if (!inputStr) return;
        var regex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        if (!regex.test(inputStr)) {
            throw new Error("Invalid email format.");
        }
        return true;
    }

    // Validate IFSC Code
    function validateIFSC(inputStr) {
        if (!inputStr) return;
        var regex = /^[A-Z]{4}0[0-9]{6}$/;
        if (!regex.test(inputStr)) {
            throw new Error("Invalid IFSC code format. It should be 4 letters followed by 0 and 6 digits.");
        }
        return true;
    }

    // Validate Phone Number
    function validatePhoneNumber(inputStr) {
        if (!inputStr) return;
        var regex = /^\d{10,16}$/;
        if (!regex.test(inputStr)) {
            throw new Error("Phone number must be between 10 and 16 digits.");
        }
        return true;
    }

    // Validate PIN Code
    function validatePincode(inputStr) {
        if (!inputStr) return;
        var regex = /^\d{6}$/;
        if (!regex.test(inputStr)) {
            throw new Error("Invalid PIN code format. It should be 6 digits long.");
        }
        return true;
    }

    // Validate Trustee Details if present
    if (inputs.response && inputs.response.data && inputs.response.data.trusteeDtls && inputs.response.data.trusteeDtls[0]) {
        var trusteeDetails = inputs.response.data.trusteeDtls[0];
        
        // Validate Trustee PAN
        if (trusteeDetails.panNo) {
            validatePAN(trusteeDetails.panNo);
        }

        // Validate Trustee Email
        if (trusteeDetails.email) {
            validateEmail(trusteeDetails.email);
        }

        // Validate Trustee IFSC Code
        if (trusteeDetails.trusteeIFSC) {
            validateIFSC(trusteeDetails.trusteeIFSC);
        }

        // Validate Trustee Phone Number
        if (trusteeDetails.mobileNo) {
            validatePhoneNumber(trusteeDetails.mobileNo);
        }

        // Validate Trustee PIN Code
        if (trusteeDetails.pincode) {
            validatePincode(trusteeDetails.pincode);
        }
    }

    // Validate Proposer's PAN if present
    if (inputs.response && inputs.response.data && inputs.response.data.proposerInfos && inputs.response.data.proposerInfos.kycDoc) {
        var proposerPAN = inputs.response.data.proposerInfos.kycDoc.panNo;
        
        // Validate Proposer PAN
        if (proposerPAN) {
            validatePAN(proposerPAN);
        }
    }

})(inputs, outputs);

