sys_variable_value.value:
(function execute(inputs, outputs) {

    var optionsArray = initializeOrUpdateOptionsArray();

    function initializeOrUpdateOptionsArray() {
        var gr = new GlideRecord('x_rptp_smartinte_0_integrationoptiondatatypemaster');
        gr.query();

        var tempArray = [];
        while (gr.next()) {
            tempArray.push(gr.getValue('option').toLowerCase());
        }
        gs.info(JSON.stringify(tempArray));
        return tempArray;
    }

    // Enhanced validation function with parent and field name for detailed error messages
    function validation(value, parentClass, fieldName) {
        if (!value) return;

        if (!optionsArray.includes(value.toLowerCase())) {
            throw new Error(`Validation failed for ${parentClass}.${fieldName}: Value "${value}" not found in the options array.`);
        }
    }

    // Validate Proposer Infos
    if (inputs.val && inputs.val.data && inputs.val.data.proposerInfos) {
        validation(inputs.val.data.proposerInfos.gender, 'proposerInfos', 'gender');
        validation(inputs.val.data.proposerInfos.mrtlSts, 'proposerInfos', 'mrtlSts');
        validation(inputs.val.data.proposerInfos.occ, 'proposerInfos', 'occ');
        validation(inputs.val.data.proposerInfos.myProf, 'proposerInfos', 'myProf');
        validation(inputs.val.data.proposerInfos.orgType, 'proposerInfos', 'orgType');
        validation(inputs.val.data.proposerInfos.indsType, 'proposerInfos', 'indsType');
        // validation(inputs.val.data.proposerInfos.nameOfOrg, 'proposerInfos', 'nameOfOrg'); // Uncomment if needed
        validation(inputs.val.data.proposerInfos.relationWithLa, 'proposerInfos', 'relationWithLa');
        validation(inputs.val.data.proposerInfos.objective, 'proposerInfos', 'objective');

        // Validate Communication Address in Proposer Infos
        if (inputs.val.data.proposerInfos.comunctnAddress) {
            validation(inputs.val.data.proposerInfos.comunctnAddress.nationality, 'proposerInfos.comunctnAddress', 'nationality');
            validation(inputs.val.data.proposerInfos.comunctnAddress.state, 'proposerInfos.comunctnAddress', 'state');
            validation(inputs.val.data.proposerInfos.comunctnAddress.country, 'proposerInfos.comunctnAddress', 'country');
        }

        // Validate Permanent Address in Proposer Infos
        if (inputs.val.data.proposerInfos.prmntAddress) {
            validation(inputs.val.data.proposerInfos.prmntAddress.state, 'proposerInfos.prmntAddress', 'state');
            validation(inputs.val.data.proposerInfos.prmntAddress.country, 'proposerInfos.prmntAddress', 'country');
        }

        // Validate KYC Documents in Proposer Infos
        if (inputs.val.data.proposerInfos.kycDoc) {
            validation(inputs.val.data.proposerInfos.kycDoc.agePrf, 'proposerInfos.kycDoc', 'agePrf');
            validation(inputs.val.data.proposerInfos.kycDoc.addPrf, 'proposerInfos.kycDoc', 'addPrf');
            validation(inputs.val.data.proposerInfos.kycDoc.idPrf, 'proposerInfos.kycDoc', 'idPrf');
        }
    }

    // Validate Life Assured Infos
    if (inputs.val && inputs.val.data && inputs.val.data.lifeAssrdInfos) {
        validation(inputs.val.data.lifeAssrdInfos.gender, 'lifeAssrdInfos', 'gender');
        validation(inputs.val.data.lifeAssrdInfos.mrtlSts, 'lifeAssrdInfos', 'mrtlSts');
        validation(inputs.val.data.lifeAssrdInfos.education, 'lifeAssrdInfos', 'education');
        validation(inputs.val.data.lifeAssrdInfos.occ, 'lifeAssrdInfos', 'occ');
        validation(inputs.val.data.lifeAssrdInfos.indtype, 'lifeAssrdInfos', 'indtype');
        validation(inputs.val.data.lifeAssrdInfos.nationality, 'lifeAssrdInfos', 'nationality');
        validation(inputs.val.data.lifeAssrdInfos.rstSts, 'lifeAssrdInfos', 'rstSts');
    }

    // Validate Nominee Infos
    if (inputs.val && inputs.val.data && inputs.val.data.nomineeInfos) {
        validation(inputs.val.data.nomineeInfos.gender, 'nomineeInfos', 'gender');
        validation(inputs.val.data.nomineeInfos.relationship, 'nomineeInfos', 'relationship');
    }

    // Validate Beneficiary Details
    if (inputs.val && inputs.val.data && inputs.val.data.beneficiaryDtls) {
        validation(inputs.val.data.beneficiaryDtls.relationWithLa, 'beneficiaryDtls', 'relationWithLa');
    }

    // Validate Trustee Details
    if (inputs.val && inputs.val.data && inputs.val.data.trusteeDtls) {
        validation(inputs.val.data.trusteeDtls.relationWithLa, 'trusteeDtls', 'relationWithLa');
        validation(inputs.val.data.trusteeDtls.state, 'trusteeDtls', 'state');
        validation(inputs.val.data.trusteeDtls.trusteeaccounttype, 'trusteeDtls', 'trusteeaccounttype');
    }

    // Validate Insurance Infos
    if (inputs.val && inputs.val.data && inputs.val.data.insuranceInfos) {
        validation(inputs.val.data.insuranceInfos.cmpany, 'insuranceInfos', 'cmpany');
    }

    // Validate ECS Details
    if (inputs.val && inputs.val.data && inputs.val.data.ecsDetails) {
        validation(inputs.val.data.ecsDetails.payAccountType, 'ecsDetails', 'payAccountType');
    }

    // Validate EIA Details
    if (inputs.val && inputs.val.data && inputs.val.data.eiaDetails) {
        validation(inputs.val.data.eiaDetails.eiaInsuranceRepository, 'eiaDetails', 'eiaInsuranceRepository');
    }

})(inputs, outputs);

