sys_variable_value.value:
(function execute(inputs, outputs) {

    function validatePAN(inputStr) {
        if (!inputStr) return;
        var regex = /^[A-Z]{5}[0-9]{4}[A-Z]$/;
        if (!regex.test(inputStr)) {
            throw new Error("Invalid PAN card format. It should be 5 letters, followed by 4 digits, and 1 letter.");
        }
        return true;
    }

    function validateEmail(inputStr) {
        if (!inputStr) return;
        var regex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        if (!regex.test(inputStr)) {
            throw new Error("Invalid email format.");
        }
        return true;
    }

    function validateIFSC(inputStr) {
        if (!inputStr) return;
        var regex = /^[A-Z]{4}0[0-9]{6}$/;
        if (!regex.test(inputStr)) {
            throw new Error("Invalid IFSC code format. It should be 4 letters followed by 0 and 6 digits.");
        }
        return true;
    }

    function validatePhoneNumber(inputStr) {
        if (!inputStr) return;
        var regex = /^\d{10,16}$/;
        if (!regex.test(inputStr)) {
            throw new Error("Phone number must be between 10 and 16 digits.");
        }
        return true;
    }

    function validatePincode(inputStr) {
        if (!inputStr) return;
        var regex = /^\d{6}$/;
        if (!regex.test(inputStr)) {
            throw new Error("Invalid PIN code format.");
        }
        return true;
    }
  if (inputs.response && inputs.response.data && inputs.response.data.trusteeDtls && inputs.response.data.trusteeDtls[0]) {
    validatePAN(inputs.response.data.trusteeDtls[0].panNo);
    validateEmail(inputs.response.data.trusteeDtls[0].email);
    validateIFSC(inputs.response.data.trusteeDtls[0].trusteeIFSC);    
    validatePhoneNumber(inputs.response.data.trusteeDtls[0].mobileNo); 
    validatePincode(inputs.response.data.trusteeDtls[0].pincode);
}
     validatePAN(inputs.response.data.proposerInfos.kycDoc.panNo);

})(inputs, outputs);

