sys_variable_value.value:
(function execute(inputs, outputs) {

    var d = inputs.res;

    if (d.data.proposerInfos) {
        safeValidateAndAssignDate(d.data.proposerInfos.dob, "proposerInfos.dob", "proposerInfos");
        safeValidateAndAssignString(d.data.proposerInfos.occDesc, "proposerInfos.occDesc", "proposerInfos");

        if (d.data.proposerInfos.comunctnAddress) {
            safeValidateAndAssignString(d.data.proposerInfos.comunctnAddress.line1, 'proposerInfos.comunctnAddress.line1', "proposerInfos.comunctnAddress");
            safeValidateAndAssignString(d.data.proposerInfos.comunctnAddress.line2, 'proposerInfos.comunctnAddress.line2', "proposerInfos.comunctnAddress");
        }

        if (d.data.proposerInfos.prmntAddress) {
            safeValidateAndAssignString(d.data.proposerInfos.prmntAddress.line1, 'proposerInfos.prmntAddress.line1', "proposerInfos.prmntAddress");
            safeValidateAndAssignString(d.data.proposerInfos.prmntAddress.line2, 'proposerInfos.prmntAddress.line2', "proposerInfos.prmntAddress");
            safeValidateAndAssignString(d.data.proposerInfos.prmntAddress.city, 'proposerInfos.prmntAddress.city', "proposerInfos.prmntAddress");
        }
    }

    if (d.data.nomineeInfos && d.data.nomineeInfos[0]) {
        safeValidateAndAssignDate(d.data.nomineeInfos[0].dob, "nomineeInfos[0].dob", "nomineeInfos[0]");

        if (d.data.nomineeInfos[0].apnteDtls) {
            safeValidateAndAssignDate(d.data.nomineeInfos[0].apnteDtls.dob, "nomineeInfos[0].apnteDtls.dob", "nomineeInfos[0].apnteDtls");
        }
    }

    if (d.data.beneficiaryDtls) {
        safeValidateAndAssignDate(d.data.beneficiaryDtls.dob, "beneficiaryDtls.dob", "beneficiaryDtls");
        safeValidateAndAssignString(d.data.beneficiaryDtls.frstNm, 'beneficiaryDtls.frstNm', "beneficiaryDtls");
        safeValidateAndAssignString(d.data.beneficiaryDtls.lstNm, 'beneficiaryDtls.lstNm', "beneficiaryDtls");
    }

    if (d.data.trusteeDtls && d.data.trusteeDtls[0]) {
        safeValidateAndAssignDate(d.data.trusteeDtls[0].dob, "trusteeDtls[0].dob", "trusteeDtls[0]");
        safeValidateAndAssignString(d.data.trusteeDtls[0].address, "trusteeDtls[0].address", "trusteeDtls[0]");
        safeValidateAndAssignString(d.data.trusteeDtls[0].trusteeNameofBankAccountHolder, 'trusteeDtls[0].trusteeNameofBankAccountHolder', "trusteeDtls[0]");
    }

    if (d.data.lifeAssrdInfos) {
        safeValidateAndAssignDate(d.data.lifeAssrdInfos.dob, "lifeAssrdInfos.dob", "lifeAssrdInfos");
    }

    function isValidDateFormat(dateStr) {
        const regex = /^\d{2}-\d{2}-\d{4}$/; // Expected format: dd-mm-yyyy
        return regex.test(dateStr);
    }

    function safeValidateAndAssignDate(dateStr, key, parentObject) {
        if (!dateStr) return; 
        if (!isValidDateFormat(dateStr)) {
            throw new Error(`Invalid date format for ${key} in ${parentObject}: ${dateStr}. Expected format: dd-mm-yyyy.`);
        }
    }

    function isValidLength(str, min = 1, max = 30) {
        return str && str.length >= min && str.length <= max;
    }

    function safeValidateAndAssignString(str, key, parentObject) {
        if (!str) return; 
        if (!isValidLength(str)) {
            throw new Error(`Invalid length for ${key} in ${parentObject}: "${str}". Length should be between 1 and 30 characters.`);
        }
    }

    function validateMinMaxDigits(inputStr, key, parentObject) {
        if (!inputStr) return; 
        var regex = /^\d{1,9}$/;
        if (!regex.test(inputStr)) {
            throw new Error(`Invalid input for ${key} in ${parentObject}: "${inputStr}". Input must be a string of digits between 1 and 9 characters long.`);
        }
    }

    if (d.data.ecsDetails?.payMicrNo) {
        validateMinMaxDigits(d.data.ecsDetails.payMicrNo, "ecsDetails.payMicrNo", "ecsDetails");
    }

})(inputs, outputs);

