sys_variable_value.value:
(function execute(inputs, outputs) {

   
    function validateAnnIncme(annIncme) {
        if (annIncme === undefined || annIncme === null) return;
        var incomeRegex = /^(?:[1-9]\d{0,12}|0)$/;
        if (!incomeRegex.test(annIncme)) {
            throw new Error("Invalid annIncme value. It should be in the range 0 – 10,00,00,00000.");
        }
        return true;
    }

    function validateString(input, key, parentObject) {
        if (input === undefined || input === null) return;
        var pattern = /^(?=.{1,30}$).*$/;
        if (!pattern.test(input)) {
            throw new Error(`Invalid length for ${key} in ${parentObject}. It must be between 1 and 30 characters long.`);
        }
    }

    function validateDigits(inputStr, key, parentObject) {
        if (inputStr === undefined || inputStr === null) return;
        var regex = /^\d{10,16}$/;
        if (!regex.test(inputStr)) {
            throw new Error(`Invalid input for ${key} in ${parentObject}. Input must be a string of digits between 10 and 16 characters long.`);
        }
        return true;
    }

    if (inputs.resp && inputs.resp.data && inputs.resp.data.proposerInfos) {
        var proposerInfos = inputs.resp.data.proposerInfos;
        validateAnnIncme(proposerInfos.annIncme);

        validateString(proposerInfos.frstNm, "frstNm", "proposerInfos");
        validateString(proposerInfos.lstNm, "lstNm", "proposerInfos");

        if (inputs.resp.data.lifeAssrdInfos && inputs.resp.data.lifeAssrdInfos.rstSts === "NRI") {
            if (proposerInfos.comunctnAddress) {
                validateDigits(proposerInfos.comunctnAddress.mobNo, "mobNo", "proposerInfos.comunctnAddress");
            }
        }
    }

    if (inputs.resp && inputs.resp.data && inputs.resp.data.lifeAssrdInfos) {
        var lifeAssrdInfos = inputs.resp.data.lifeAssrdInfos;

        validateString(lifeAssrdInfos.frstNm, "frstNm", "lifeAssrdInfos");
        validateString(lifeAssrdInfos.lstNm, "lstNm", "lifeAssrdInfos");
    }

    if (inputs.resp && inputs.resp.data && inputs.resp.data.nomineeInfos && inputs.resp.data.nomineeInfos[0]) {
        var nomineeInfos = inputs.resp.data.nomineeInfos[0];

        validateString(nomineeInfos.frstNm, "frstNm", "nomineeInfos[0]");
        validateString(nomineeInfos.lstNm, "lstNm", "nomineeInfos[0]");

        if (nomineeInfos.apnteDtls) {
            validateString(nomineeInfos.apnteDtls.frstNm, "frstNm", "nomineeInfos[0].apnteDtls");
            validateString(nomineeInfos.apnteDtls.lstNm, "lstNm", "nomineeInfos[0].apnteDtls");
        }
    }

    if (inputs.resp && inputs.resp.data && inputs.resp.data.beneficiaryDtls) {
        var beneficiaryDtls = inputs.resp.data.beneficiaryDtls;

        validateString(beneficiaryDtls.frstNm, "frstNm", "beneficiaryDtls");
        validateString(beneficiaryDtls.lstNm, "lstNm", "beneficiaryDtls");
    }

    if (inputs.resp && inputs.resp.data && inputs.resp.data.trusteeDtls) {
        var trusteeDtls = inputs.resp.data.trusteeDtls;

        validateString(trusteeDtls.name, "name", "trusteeDtls");
    }

})(inputs, outputs);

